import PostBox from "./PostBox";
import {BeatLoader} from "react-spinners";
import {useSelector} from 'react-redux';


function Posts() { 

const diaries = useSelector((state) => state.diariesReducer);

console.log(diaries);

    return ( 
       <div>

           {/* Loader */}

           <div className="p-3 flex bg-red-100">

              <div className="text-center text-gray-400 p-2 m-auto bg-green-100">

                  <BeatLoader size={48} color='cyan' loading/>
                  <p>fetching diaries...</p>

              </div>

            </div>
            {
            diaries.map((diary) =>(

                 <PostBox key={diary._id} diary={diary}/>

            ))
            }
        </div>

    )
}

export default Posts;
